import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import { BrowserRouter as Router,Route, BrowserRouter } from "react-router-dom";


function App() {
  return (
      <div className="App">
          <BrowserRouter>
          <Router>
            
           <Navbar/>
           <Footer/>

          </Router>
          
          </BrowserRouter>
          
          
      </div>
  );
}

export default App;
